import React from "react";

export default function AddStudent()
{
    return(
        <>
        <div className="container">
            <form>
                <input type="text" name="fname" placeholder="Enter the first name" className="mb-3" />
                <input type="text" name="lname" placeholder="Enter the last name" className="mb-3" />
                <input type="text" name="email" placeholder="Enter the email" className="mb-3" />
                <input type="text" name="password" placeholder="Enter the password" className="mb-3" />
                <input type="submit" value="Add new Student" className="btn btn-success" />
            </form>

        </div>
        </>
    )
}
